import React from 'react';

const Task = (props: any) => {
    return (
        <li className="list-item" key={props.key}>
            <div className="d-flex-row" key={props.key}>
                {props.task.task}
                {/* <button onClick={() => props.onDeleteTask(props.id)}>Delete</button> */}
            </div>
        </li>
    );
}

export default Task;
